import React from 'react';
import { Card, CardContent, Typography } from "@material-ui/core";
import { CardActions, Button } from "@material-ui/core";

const MyCard =()=>{

    const getMatchCart=()=>{
        return (
            <Card>
                <CardContent>
                <Grid container>
                    <Grid item>
                        <Typography>First Team</Typography>
                    </Grid>
                    <Grid item>
                    <Typography>First Team</Typography>
                    </Grid>
                    <Grid item>
                    <Typography>First Team</Typography>
                    </Grid>

                </Grid>

                    <Typography>This is card</Typography>
                </CardContent>
                <CardActions>
                    <Button variant="contained" color="primary">
                      Show Detail
                    </Button>
                    <Button variant="contained" color="primary">
                        {new Date().toString()}
                    </Button>
                    
                </CardActions>

            </Card>
        );
    };

    return getMatchCart();

   
};
export default MyCard;
